    WRITE_DATA:'write data',
    ADD: 'Add',
    TOODOS: 'Toodos',
    WRITE_TEXT: 'write text',
    GO_BACK: 'Go Back',
    EDIT: 'Edit',
    DELETE: 'delete',

    HTML_FOR:{
        DATE: 'date',
        TEXT: 'text'
